@Maria_BlackIce 으응 ..

(  약을 발라야 한다는 말에 , 작게 고개 끄덕이며 얌전히 당신을 바라보았어요 .  )

.. 고마워요 .

@Maria_BlackIce "크리스마스에만 보자는 게 아니라.. 크리스마스에'도' 보자고요."

한숨.

"짓궂다니까."

@Maria_BlackIce "원래 까까 사주는 아저씨도 동네 돌아다니는 친정한 아저씨야.."

무슨 공통점이 있는지는 모르겠지만.

"아무튼. 귀여우니까 되... 었는걸."

@_blk_rudbeckia "글세요. 벌써 오래전 일이라 저도 까먹었네요."

(피식웃었다. 그때모인 면면들도 지금에와선 몇 안남았단 사실이 조금 슬퍼지긴했다.)

"앞으로 더 열심히 살아야겠어요. 그래야 매년 사람들과 연말연시를 보내지.."

@Maria_BlackIce "잘 지냈다니 다행인걸-"
*끄덕거리네요.

"컨디션도 좋은걸까ㅡ?"

@Maria_BlackIce "오. 겸손하시긴."

피식.

"Hello. 부르셨었던가요? 기억이 잘 안 나네."

@Maria_BlackIce "곤혹스러울 때요?"

갸웃. 호기심에 목소리가 저도 모르게 은근해졌다.

"... 뭔데요?"

@Maria_BlackIce "뭘요. 난 다 들었거든요."

튕기시기는. 중얼거리며 새로 담겨 나온 맥주를 홀짝였고.

"인상깊더라고요. 역시 우리 고용주님이야, 같은?"

@Maria_BlackIce "어머.."

피식.

"건강하단 증거네요. 음음."

@JY_Seina_MOFAT "저희 합중국 뉴욕시에서 그린플루와 관련된 사건이 일어났었습니다만.."

(차원이란 이야기가 나오자 순간 번뜩였다.)

"베타에서 왔다고 말하면 된다고 들은 기억이 납니다."

@Maria_BlackIce "전혀."

가볍게 고개를 저어보이곤.

"옛날에, 신년 파티에서 마리아 씨가 노래를 불렀던 게 언듯 떠올랐거든요. 그때. 정말 잘 불렀는데."

@_blk_rudbeckia "잘부르기보다는 그냥 즐기면서 부르죠. 누구한테 들려줄만한 것도 아니고.."

(노래 이야기에 머쓱해진듯 맥주를 홀짝인다.)

"일리야씨는 어때요? 잘부르는 편이에요?"

@Maria_BlackIce "생식 기능까지, 모조리 남성이었다는 이야기죠?"

심각한 표정.

"... 제약 회사는 이래서 불안하다니까.."

@Maria_BlackIce "...음, 별거아냐."
*자신을 이상하게 봐도, 어깨를 으쓱이며 말할 뿐이네요.

"잘 지냈어ㅡ?"
